import { componentDidMount } from 'react';
import './App.scss';


componentDidMount(
  fetch('https://api.flickr.com/services/feeds/photos_public.gne?format=json')
  .then(function(response){
    return response.json();
  })
)







function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>I'm so ace</p>
      </header>
    </div>
  );
}

export default App;
